$(document).ready(function () {$(document).on('click', '.level', function (e) {e.preventDefault();var route = $(this).attr('data-route');var id = $(this).attr('data-div');$.ajax({type: "get",url: route,success: function (data) {$('#' + id).html(data);swet('تم بنجاح .', 'info');},error: function (xhr, status, error) {swet('error', 'info');}})});$(document).on('click', '.classrome-edit', function (e) {e.preventDefault();var route = $(this).attr('data-route');$.ajax({type: "get",url: route,dataType: "JSON",success: function (databack) {$('#id').val(databack.id);$('#uuid').val(databack.uuid);$('#name').val(databack.name);$('#code').val(databack.code);$('#school_id').val(databack.school_id);$('#level_id').val(databack.level_id);$('#teacher_id').val(databack.teacher_id);},error: function (xhr, status, error) {swet('error', 'info');}})});$(document).on('click', '.level-supervisor', function (e) {e.preventDefault();var route = $(this).attr('data-route');var model = $('#form-supervisor-body-in-model');$.ajax({type: "get",url: route,success: function (databack) {model.html(databack);console.log(databack);},error: function (xhr, status, error) {swet('error', 'info');}});});$(document).on('click', '.students-all', function (e) {e.preventDefault();$('#table-students').html('');var route = $(this).attr('data-route');var classname = $(this).attr('class-name');$.ajax({type: "get",url: route,success: function (databack) {$('#table-students').html(databack);$('#table-students').prepend('<h3 class="text-center">' + classname + '</h3>');swet('تم بنجاح .', 'info');},error: function (xhr, status, error) {}});$('#TABLE-heid').show();});$(document).on('click', '.sahe', function (e) {var id = $(this).parents('tr');swet('حاضر', 'success');$(id).fadeOut().remove(id);$(document).on('click', '.nom', function (e) {var id = $(this).parents('tr');swet('غايب', 'warning');$(id).fadeOut().remove(id);$('.child').remove();});});});